import React from 'react';
import { AiOutlineSearch } from 'react-icons/ai';


const Search = () => {
  return (
    <div className='w-full h-screen relative mt-[-50px]'>

      

      <div className='absolute top-0 w-full h-full flex flex-col justify-center text-center text-white p-4'>
        
        <h2 className='py-4 text-3xl font-bold text-[#5B112B] font-[Poppins]'>Rechercher Une Cr√©che </h2>
        
        <form
          className='flex justify-between items-center max-w-[700px] mx-auto w-full border border-[#ED6361] p-1
          rounded-md text-white bg-[#5B112B] hover:scale-105 duration-300'
        >
            
          <div >
            <input
              className='bg-transparent w-[150px] sm:w-[400px] font-[Poppins] focus:outline-none'
              type='text'
              placeholder='  Saisissez un lieu'
            />
          </div>

          <div>
            <button className=' mr-1 p-3 border border-[#ED6361] bg-transparent  text-white rounded-md hover:scale-105 duration-300'>
              <AiOutlineSearch size={20} className='icon color:#5B112B text-2xl cursor-pointer' style={{color: '#ffffff'}}  />
            </button>
          </div>

        </form>

      </div>

    </div>
  );
};

export default Search;
